import React, { useEffect, useState } from "react";

function Messages() {
    const [messages, setMessages] = useState()

    useEffect(() => {
        fetch("/messages")
        .then((res) => res.json())
        .then((res) => console.log(res))
    })


    return (
        <h1>{messages}</h1>
    )
}

export default Messages;
